世界有数のチュナーメーカーBRABUS（ブラバス）。メルセデスそのものが持つ高品質、高性能をいっそう引き立てるカスタマイジングで本物を志向するカスタマーを魅了します。 <br>さりげないオシャレを楽しむ為のＢＵＲＡＢＵＳアイテム。<br>※当商品はBRABUS正規品です。※写真と実際の商品は異なります。 <br>対応車種：Mベンツ R171 SLKクラス <br>　車検対応品<br>インテリア/インテリアその他<tr><td colspan="2">
